    "import pandas as pd\n",
    "import seaborn as sns\n",
    "import matplotlib.pyplot as plt\n",
    "\n",
    "# df_bc = pd.read_csv(\"breast_cancer.csv\")\n",
    "\n",
    "df = df_bc[[\"area_mean\", \"diagnosis\"]].copy()\n",
    "df[\"area_mean\"] = pd.to_numeric(df[\"area_mean\"], errors=\"coerce\")\n",
    "df[\"diagnosis\"] = (\n",
    "    df[\"diagnosis\"]\n",
    "      .astype(str).str.strip().str.lower()\n",
    "      .replace({\"malignant\":\"m\", \"benign\":\"b\"})\n",
    "      .str.upper()\n",
    ")\n",
    "df = df.dropna(subset=[\"area_mean\", \"diagnosis\"])\n",
    "\n",
    "sns.set_context(\"notebook\")\n",
    "sns.set_style(\"whitegrid\")\n",
    "\n",
    "ax = sns.kdeplot(\n",
    "    data=df,\n",
    "    x=\"area_mean\",\n",
    "    hue=\"diagnosis\",\n",
    "    hue_order=[\"M\", \"B\"],\n",
    "    common_norm=False,   # donâ€™t force totals to 1 across groups\n",
    "    fill=False,          # outlines only; set True if you want filled curves\n",
    "    linewidth=2\n",
    ")\n",
    "\n",
